import 'dart:convert';
import 'dart:typed_data';
class Category{
  String cat_id;
  String name;
  Uint8List imgInBytes;
  String img;

  bool isClicked = false;
  void setImage(){
    if(img=="false")
      img="";
    imgInBytes = base64Decode(img);
  }
  Category({this.cat_id,this.name,this.img});
  factory Category.fromJSON(Map<String,dynamic> json){
    return Category(
      cat_id: json["cat_id"],
          name  : json["cat_name"]

    );
  }


}